var generate_name = function (model) {
    var letter = "";
    var key = "   ";
    var name = "";

    for(var i = 0; i < 15; i++){
        var probability = Math.random();
        distribution = model[key]
        for(var j = 0; j < distribution.length; j++){
            probability = probability - distribution[j][1];
            if(probability < 0){
                letter = distribution[j][0];
                break;
                }
            }
        if(letter == " "){
          break
        }
        else{
          name = name + letter;
          key = key.slice(1, 3) + letter;
        }
    }
    return name;
};

function includes(arr,obj) {
    return (arr.indexOf(obj) != -1);
}


function generate_karlanafn() {
  while(true){
    name = generate_name(karla_model);
    if(includes(karlanofn,name) === false){
      break;
    }
  }
    document.getElementById("karlmanns_takki").innerHTML = name;
}

